Lemma AddrE_conform: 
forall l b l' k,
encode_AddrE k b = OK l ->

AddrE_op_to_bp (AddrE_to_op k) (bytes_to_bits_opt (l++l'))=true.

Proof.
idtac "========== Start to prove Encode AddrE Conform ==========".
intros until k.
rewrite bytes_to_bits_opt_app.
induction k;simpl;
repeat rewrite_const_byte_in_goal;
intro Enc;
repeat decision_inv;monadInv Enc;
repeat ind_builtIn;repeat destr_all_lists;
try destr_byte b.

(*prove AddrE12_conform Lemma *)
idtac "Encode Conform: AddrE12 1/10".
autounfold with AddrE_bpdb;
autounfold with bitfields;
cbn [proj1_sig] in *;
cbn [app];
repeat rewrite bytes_to_bits_cons_correct by auto;
(repeat destruct_neq_list;ring).

