Lemma AddrE_orth: 
forall bp l l' b k,
In bp AddrE_bp_list ->
encode_AddrE k b = OK l ->
bpt_neq (AddrE_op_to_bp (AddrE_to_op k)) bp ->
bp (bytes_to_bits_opt (l++l')) = false.
Proof.
idtac "========== Start to prove Encode AddrE Orthogonal ==========".
intros until k;simpl.
intro BpIn. intro Enc.
generalize (AddrE_conform _ _ l' _ Enc).
intro Bp.
intro Neq.
induction k;simpl in *.
(*prove AddrE12_orth Lemma *)
idtac "Encode Conform: AddrE12 1/10".
destruct l as [|ii l];cbn [app] in *;
[repeat decision_inv;monadInv Enc|destr_byte ii].

apply AddrE12_bp_true in Bp.
destruct_conjunction Bp.
repeat destruct BpIn as [BpIn| BpIn];subst;
repeat rewrite bytes_to_bits_cons_correct by auto;
apply bpt_neq_sound in Neq;try contradiction;
(autounfold with AddrE_bpdb);
(repeat destruct_neq_list;simpl;destruct_uncare_bit;ring).

