Lemma encode_AddrE_consistency: 
forall data inByte bin l ,
encode_AddrE data inByte = OK bin ->

decode_AddrE (bin++l) = OK(data, length(bin)).

Proof.
idtac "========== Start to prove Encode AddrE Consistency ==========".
intros data inByte bin l HEncode.
unfold decode_AddrE.
destruct data eqn:EQI;repeat ind_builtIn;
generalize (AddrE_conform _ _ l _ HEncode);intros HBpT;simpl in HBpT.
(*prove AddrE12*)
idtac "Encode Consistency: : AddrE12 1/10".
simpl_branch_encode_last.
try simpl in HEncode;repeat decision_inv;monadInv HEncode;
repeat rewrite<-app_comm_cons;repeat rewrite<-app_assoc.
do 0 get_len_facts.
solve_try_get_n.
solve_assertion.
solve_try_skip_n.
solve_equal.

(*prove AddrE11*)
idtac "Encode Consistency: : AddrE11 2/10".
simpl_branch_encode AddrE_bp_in_list0 AddrE_bp_neq0_1 encode_AddrE AddrE_orth.
simpl_branch_encode_last.
try simpl in HEncode;repeat decision_inv;monadInv HEncode;
repeat rewrite<-app_comm_cons;repeat rewrite<-app_assoc.
do 1 get_len_facts.
solve_try_skip_n.
solve_try_first_n.
