forall b1 b2 b3 b4 b5 b6 b7 b8 l k,
encode_AddrE k bB[[b1;b2;b3;b4;b5;b6;b7;b8]] = OK l ->
exists b1' b2' b6' b7' b8' l', l = bB[[b1';b2';b3;b4;b5;b6';b7';b8']]::l'.
Proof.
intros until k.
induction k;simpl;intro Enc;
repeat decision_inv;monadInv Enc;
repeat ind_builtIn;repeat destr_all_lists;
autounfold with bitfields;cbn[proj1_sig];
repeat rewrite bytes_to_bits_cons_correct by auto;
simpl;repeat eexists.
Qed.


Lemma encode_AddrE_len: 
forall b l k,
encode_AddrE k b = OK l ->
length l >=1.

Proof.
intros until k.
induction k;simpl;
intro Enc;
repeat decision_inv;monadInv Enc;simpl;omega.

Qed.



