Lemma encode_Instruction_consistency: 
forall data bin l ,
encode_Instruction data = OK bin ->

decode_Instruction (bin++l) = OK(data, length(bin)).

Proof.
idtac "========== Start to prove Encode Instruction Consistency ==========".
intros data bin l HEncode.
unfold decode_Instruction.
save48.
destruct data eqn:EQI;repeat ind_builtIn;
generalize (Instruction_conform _ l _ HEncode);intros HBpT;simpl in HBpT.
(*prove Ptestq_EvGv*)
idtac "Encode Consistency: : Ptestq_EvGv 1/127".
simpl_branch_encode_last.
try simpl in HEncode;repeat decision_inv;monadInv HEncode;
repeat rewrite<-app_comm_cons;repeat rewrite<-app_assoc.
do 0 get_len_facts.
solve_try_get_n.
solve_assertion.
solve_assertion.
solve_assertion.
solve_try_skip_n.
solve_try_skip_n.
simpl_klass_encode EQ.
solve_preserve_klass encode_AddrE encode_AddrE_preserve.
solve_try_get_n.
solve_assertion.
solve_klass encode_AddrE encode_AddrE_consistency.
solve_try_skip_n.
solve_equal.

